import React from "react";
import classes from "./ProjectOverviewBox.modules.css";

const ProjectOverviewBox = (props) => {
  <div className={classes.ProjectContainer}>
    <div className={classes.Box}>name:{props.name}</div>
    <p>
      Date Posted:<span>{props.date}</span>
    </p>
  </div>;
};

export default ProjectOverviewBox;
